import React from 'react';
import './App.css';
import { BrowserRouter } from 'react-router-dom'
import Main from './components/Main';
import ContactFooter from './components/widgets/ContactFooter';

function App() {
  return (
    <BrowserRouter>
      <Main/>
      <ContactFooter />
    </BrowserRouter>
  );
}

export default App;
